import User from "../models/user.model.js"
import bcrypt from 'bcryptjs'
import { createAccessToken } from '../libs/jwt'
import jwt from "jsonwebtoken";
import {TOKEN_SECRET} from '../config.js'

export const register = async (req, res) =>{
    const { email, password, username } = req.body
   try {

    const userFound = await User.findOne({email});
    if(userFound) return res.status(400).json(["The email is already in use"]);

    const passwordHash = await bcrypt.hash(password, 10)
    const newUser = new User({
        username,
        email,
        password: passwordHash,
    })
    
    const userSaved = await newUser.save()
    const token = await createAccessToken({id:userSaved._id})
    res.cookie('token', token)
    
    res.json({
        id:userSaved._id,
        username:userSaved.username,
        email:userSaved.email,
        createdAt:userSaved.createdAt,
        updatedAt: userSaved.updatedAt,
    })

    console.log("Estoy en Register de Railway")
   } catch (error) {
    res.status(500).json({ message: error.message})
   }
}

export const login = async (req, res) =>{
    const {email, password, username} = req.body
   try {
    const userFound = await User.findOne ({email})
    
    if (!userFound) return res.status(400).json({message:"User not found"})


    const isMatch = await bcrypt.compare(password, userFound.password)
    if(!isMatch) return res.status(400).json({message:"Incorrect password"})
    
    const token = await createAccessToken({id:userFound._id})
    res.cookie('token', token, {
        httpOnly: false, // client can't get cookie by script
        secure: true, // only transfer over https
        sameSite: "None" // only sent for requests to the same FQDN as the domain in the cookie
      })
    
    res.json({
        id:userFound._id,
        username:userFound.username,
        email:userFound.email,
        createdAt:userFound.createdAt,
        updatedAt: userFound.updatedAt,
    })
    console.log("Estoy en Login de Railway")
    
   } catch (error) {
    res.status(500).json({ message: error.message})
    
   }
   
}

export const logout = async(req,res) =>{
    res.cookie("token","",{
        expires: new Date(0)
    });
    console.log("Estoy en logout de Railway")
    return res.sendStatus(200)
}

export const profile = async(req,res) =>{
    const userFound = await User.findById (req.user.id)
    
    if(!userFound) return res.status(400).json({message: "User not found"})
    
    return res.json({
        id: userFound._id,
        username: userFound.username,
        email: userFound.email,
        createdAt: userFound.createdAt,
        updatedAt: userFound.updatedAt
    })
};

export const verifyToken = async (req, res) =>{
    const {token} = req.cookies
   
    if(!token) return res.status(401).json({message: 'Unauthorized'})
   
    jwt.verify(token, TOKEN_SECRET, async(err, user) =>{
        if(err) return res.status(401).json({message: 'Unauthorized'})

        const userFound = await User.findById(user.id)
        if (!userFound) return res.status(401).json({message: 'Unauthorized'})

        return res.json({
            id: userFound._id,
            username: userFound.username,
            email: userFound.email
        });
        
    });
    console.log("Estoy en verifyToken de Railway")
};

